import React from 'react';
import './Product.css';

function Product(props) {
    const {name, picture, price} = props.product;
    return (
        <div className='productContainer'>
            <div>
                <img src={picture}/>
            </div>
            <div>
                <div className='productname'>
                    {name}
                </div>
                <div className='productPrice'>
                    {price}
                </div>
            </div>
        היי שלום
        </div>
    )
}

export default Product;
